import React from 'react';
import TableUsers from "../components/TableUsers";
import '../styles/App.css'

const Users = ({clients}) => {
    return (
        <div className="App">
            <h1>Users:</h1>
            <TableUsers users={clients}/>
        </div>
    );
};

export default Users;
